import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
    {/*upper-left*/}
    <div className="circlePosition w-[200em] h-[150em] bg-[#95D9F2] rounded-[100%] absolute z-[-1] top-[100%] left-[100%] translate-x-[-100%] translate-y-[-100%] blur-[10em]"></div>
    {/*upper-right*/}
    <div className="circlePosition w-[200em] h-[150em] bg-[#88B4F4] rounded-[100%] absolute z-[-1] top-[100%] left-[50%] translate-x-[0%] translate-y-[-100%] blur-[10em]"></div>
    {/*upper-left*/}
    <div className="circlePosition w-[200em] h-[150em] bg-[#959CF1] rounded-[100%] absolute z-[-1] top-[100%] left-[100%] translate-x-[-100%] translate-y-[-30%] blur-[10em]"></div>
    {/*upper-right*/}
    <div className="circlePosition w-[200em] h-[150em] bg-[#C9FAF6] rounded-[100%] absolute z-[-1] top-[100%] left-[50%] translate-x-[0%] translate-y-[-30%] blur-[10em]"></div>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
